First of all, you need to define the plonk-pallet when you start to implement your pallet. Please define as following. /Cargo.toml [dependencies]
plonk-pallet = { git = "https://github.com/AstarNetwork/plonk", branch = "master", default-features = false }
rand_core = {version="0.6", default-features = false } The plonk-pallet depends on rand_core so please import it.

