The plonk functions is available on your pallet so we are going to test them as following tests. /src/lib.rs /// The trusted setup test Ok and Err
#[test]
fn trusted_setup() { new_test_ext().execute_with(|| { let rng = get_rng(); assert_ok!(Plonk::trusted_setup(Origin::signed(1), 12, rng)); let rng = get_rng(); assert_eq!( Plonk::trusted_setup(Origin::signed(1), 12, rng), Err(DispatchErrorWithPostInfo { post_info: PostDispatchInfo::from(()), error: DispatchError::Other("already setup"), }) ); })
} /// The set `Thing1` storage with valid proof
#[test]
fn sums_thing_one_with_valid_proof() { new_test_ext().execute_with(|| { let rng = get_rng(); assert_ok!(Plonk::trusted_setup(Origin::signed(1), 12, rng)); let pp = Plonk::public_parameter().unwrap(); let mut circuit = TestCircuit::default(); let (pk, vd) = circuit.compile(&pp).unwrap(); let proof = { let mut circuit = TestCircuit { a: BlsScalar::from(20u64), b: BlsScalar::from(5u64), c: BlsScalar::from(25u64), d: BlsScalar::from(100u64), e: JubJubScalar::from(2u64), f: JubJubAffine::from(GENERATOR_EXTENDED * JubJubScalar::from(2u64)), }; circuit.prove(&pp, &pk, b"Test").unwrap() }; let public_inputs: Vec<PublicInputValue> = vec![ BlsScalar::from(25u64).into(), BlsScalar::from(100u64).into(), JubJubAffine::from(GENERATOR_EXTENDED * JubJubScalar::from(2u64)).into(), ]; assert_ok!(SumStorage::set_thing_1(Origin::signed(1), 42, vd, proof, public_inputs, Transcript(b"Test"))); assert_eq!(SumStorage::get_sum(), 42); });
} /// The set `Thing1` storage with invalid proof
#[test]
fn sums_thing_one_with_invalid_proof() { new_test_ext().execute_with(|| { let rng = get_rng(); assert_ok!(Plonk::trusted_setup(Origin::signed(1), 12, rng)); let pp = Plonk::public_parameter().unwrap(); let mut circuit = TestCircuit::default(); let (pk, vd) = circuit.compile(&pp).unwrap(); let proof = { let mut circuit = TestCircuit { a: BlsScalar::from(20u64), b: BlsScalar::from(5u64), c: BlsScalar::from(25u64), d: BlsScalar::from(100u64), e: JubJubScalar::from(2u64), f: JubJubAffine::from(GENERATOR_EXTENDED * JubJubScalar::from(2u64)), }; circuit.prove(&pp, &pk, b"Test").unwrap() }; let public_inputs: Vec<PublicInputValue> = vec![ // Change the value BlsScalar::from(24u64).into(), BlsScalar::from(100u64).into(), JubJubAffine::from(GENERATOR_EXTENDED * JubJubScalar::from(2u64)).into(), ]; assert!(SumStorage::set_thing_1(Origin::signed(1), 42, vd, proof, public_inputs, Transcript(b"Test")).is_err()); assert_eq!(SumStorage::get_sum(), 0); });
} With above tests, we can confirm that your pallet is coupling with plonk-pallet and these functions work correctly. You can check the plonk-pallet specification here . Happy hacking!
